import logo from './logo.svg';
import './App.css';

function Navbar() {
  return (
    <nav class="navbar">
    <ul class="navbar-menu">
        <li><a href="#">Accueil</a></li>
        <li><a href="#">Équipe</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
    </ul>
</nav>
)}

function Header() {
  return(
  <header class="header">
  <h1 class="header-title">Découvrez notre équipe</h1>
  <p class="header-subtitle">Une présentation élégante et moderne</p>
</header>
)}

function About() {
  return (
    <section class="about">
    <div class="about-content">
        <h2>À propos de nous</h2>
        <p>
        Nous sommes une équipe de passionnés, spécialisée dans la création d'interfaces utilisateur élégantes et fonctionnelles.
        Avec une expertise en développement et en design, nous aimons créer des expériences web modernes et interactives.
        </p>
    </div>
</section>
)}

function Button() {
  return (
    <button class="card-button">En savoir plus</button>
  )
}

function Card() {
  return(
    <div class="cards-container">
    <div class="card">
        <img src="https://i.pravatar.cc/300?img=11" alt="Portrait" class="card-image" />
        <div class="card-content">
            <h2 class="card-title">Maxime Faubert</h2>
            <p class="card-description">
                Développeur Front-end passionné par les interfaces élégantes et réactives.
            </p>
            <button class="card-button">En savoir plus</button>
        </div>
    </div>
    <div class="card">
        <img src="https://i.pravatar.cc/300?img=10" alt="Portrait" class="card-image" />
        <div class="card-content">
            <h2 class="card-title">Emilie Goudreau</h2>
            <p class="card-description">
                Designer créatif avec un œil pour le détail et l'harmonie des couleurs.
            </p>
            <button class="card-button">En savoir plus</button>
        </div>
    </div>
    <div class="card">
        <img src="https://i.pravatar.cc/300?img=32" alt="Portrait" class="card-image" />
        <div class="card-content">
            <h2 class="card-title">Alice Lafond</h2>
            <p class="card-description">
                Chef de projet avec une expertise en gestion agile et communication efficace.
            </p>
            <Button />
        </div>
    </div>
    <div class="card">
        <img src="https://i.pravatar.cc/300?img=7" alt="Portrait" class="card-image" />
        <div class="card-content">
            <h2 class="card-title">Paul Guédry</h2>
            <p class="card-description">
                Développeur Full-stack aimant résoudre des problèmes complexes avec du code propre.
            </p>
        </div>
    </div>
</div>
  )
}

function App() {
  return (
    <>
    <Navbar /> 
    <Header />
    <Card/>
    </>
  );
}

export default App;
